import React from 'react';
import { Link } from 'react-router-dom';

export default function Home() {
    return (
        <>
        <h1 className='heading'>PlanetX</h1>
        <Icon icon= "line-md:github-loop" style="color: white;"></Icon>
        <div>
            <Link className='home-link' to="/NasaPhoto">See into the stars!</Link>
            <Link className='home-link' to="/WildFire">Track Wildfire</Link>
            <Link className='home-link' to="/Perseverance">Mars</Link>
            <Link className='home-link' to="/Earth">Earth</Link>
        </div>
        </>
    )
}
